def prime_factors(lst):
    if len(lst)<=84:
        return "Error: List does not have 85 elements"

    number = lst[84]
    factors = set()
    i = 2
    while i * i <= number:
        if number % i:
            i += 1
        else:
            number //= i
            factors.add(i)
    if number > 1:
        factors.add(number)

    return factors
